import React, {useState} from 'react';
import {View, SafeAreaView, Text, StyleSheet, TextInput, FlatList, Image, ScrollView, TouchableOpacity, ImageBackground} from 'react-native';
import Icon2  from 'react-native-vector-icons/AntDesign';
import Icon  from 'react-native-vector-icons/Feather';
import Icon3  from 'react-native-vector-icons/Entypo';
import styled from 'styled-components/native';
import {VectorHeader} from '../../components/screenComponents/components';
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";



const Tabs = createMaterialTopTabNavigator();



const Top= styled.ImageBackground`
height: 320px;
justify-content:space-between;
`;

const TopText1= styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 700;
font-size: 24px;
color: #FFFFFF;
`;

const TopText2= styled.Text`
font-family: 'Roboto';
font-style: normal;
font-size: 16px;
font-weight: 300;
color: #FFFFFF;
`;

const Texts= styled.View`
    width:85%;
    margin:0 20px 15px 20px;
    flex-direction:row;
    justify-content:space-between;
  
`;

const StyledImage= styled.Image`
width: 56px;
height: 56px;
border-radius: 5px;
  
`;


const StyledText1= styled.Text`
font-family: Roboto;
font-size: 16px;
font-weight: 300;
color: #C4C4C4;  
`;


const StyledText2= styled.Text`
font-family: Roboto;
font-size: 24px;
font-weight: 700;
 color: #FFFFFF; 
`;

const StyledText3= styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 900;
font-size: 18px;

color: #FFFFFF;
`;










const Category1=({navigation})=>{
    const meals = [
         {image:require('../../../assets/foodImg2.png'), name: 'Name of meal', description:'Detailed description of meal', price:'N0.00', time:'30 mins'},
         {image:require('../../../assets/foodImg3.png'), name: 'Name of meal', description:'Detailed description of meal', price:'N0.00', time:'30 mins'},
         {image:require('../../../assets/foodImg10.png'), name: 'Name of meal', description:'Detailed description of meal', price:'N0.00', time:'30 mins'},
         {image:require('../../../assets/foodImg11.png'), name: 'Name of meal', description:'Detailed description of meal', price:'N0.00', time:'30 mins'}   
    ]
    return(
    <View style={styles.container}>
    <ScrollView showsVerticalScrollIndicator={false}>
        {meals.map((item, index)=>{
            return(
                <View style={[styles.row, {paddingTop:20, marginLeft:20, marginRight:20, paddingBottom:15, borderBottomWidth:1, borderBottomColor:'#4E4E4E', height:'30%'}]}  key={index}>
            <View style={styles.row}>
                <StyledImage source={item.image}/>
                <View style={{marginLeft:20, justifyContent:'space-between'}}>
                    <View>
                        <StyledText2>{item.name}</StyledText2>
                        <StyledText1>{item.description}</StyledText1>
                    </View>    
                    <StyledText3>{item.price}</StyledText3>
                </View>
            </View>
            <View style={styles.right}>
                <Icon name="clock" size={16} color="#C3AD60" />
                <View style={{alignItems:'center'}}>
                    <StyledText1 style={styles.min}>{item.time}</StyledText1>
                </View>
            </View>
        </View>
                )
        })

        }
        
      </ScrollView>  
    </View> 

)}






export default function Food3({navigation}){

	return(
	<SafeAreaView style={styles.container}>	
      <Top source={require('../../../assets/foodTop.png')}>
        <View style={styles.vector}>
              <TouchableOpacity onPress={()=>navigation.navigate('Food2')}>
                  <Icon2 name="back" style={{marginLeft:20}} size={25} color="#C3AD60" />
              </TouchableOpacity>
              <View style={{width:1}}></View>
        </View>
        <Texts>
          <View style={{width:'80%'}}>
            <TopText1>Brand Name - Locale</TopText1>
            <View style={styles.text}><TopText2>0.7km away</TopText2><TopText2>Delivery fee N0.00</TopText2></View>
          </View>
          <View style={{justifyContent:'center', alignItems:'flex-end', flexDirection:'row'}}>

            <TopText2><Icon3 name="star-outlined" size={13} color="#C3AD60" />4.5</TopText2>
            
          </View>
        </Texts>
      </Top>  
        
        <Tabs.Navigator
            headerMode="none"
            screenOptions={{
                tabBarShowIcon: true,
                tabBarActiveTintColor: '#C3AD60',
            tabBarInactiveTintColor: '#ddd',
                tabBarIndicatorStyle: {
                    backgroundColor: '#000',
                },

                tabBarStyle: {
                    borderTopWidth: 2,
                    elevation: 10,
                    backgroundColor: '#000',
                    borderRadius: 1

                }
            }}>
               <Tabs.Screen
                name="Category1"
                component={Category1}
                options={{
      headerShown: false,}}
            />
            <Tabs.Screen
                name="Category2"
                component={Category1}
                options={{
      headerShown: false,}}
            />
             <Tabs.Screen
                name="Category3"
                component={Category1}
                options={{
      headerShown: false,}}
            />
            
            </Tabs.Navigator>   
    </SafeAreaView>	

)}


const styles = StyleSheet.create({
  container:{
    flex:1,
    backgroundColor:'#000',
  },
  vector:{
    flexDirection:'row',
    height:80,
    alignItems:'center',
  },
  text:{
    flexDirection:'row',
    justifyContent:'space-between'

  },
  row:{
    flexDirection:'row',
    justifyContent:'space-between'
  },
  right:{
    width:'13%',
    justifyContent:'space-between',
    alignItems:'center'
  },
  min:{
    textAlign:'center'
  }


})
